from src.hvac_rectangular_categoriser import HvacRectangularCategoriserclass TestCategoriser:    def test_categoriser_when_called_with_width_lt_750_width_plus_length_lt_1150_returns_1(self):        categoriser = HvacRectangularCategoriser()        result = categoriser.evaluate(749, 401)        assert result == 1    def test_categoriser_when_called_with_width_lt_750_width_plus_length_gt_1150_returns_2(self):        categoriser = HvacRectangularCategoriser()        result = categoriser.evaluate(749, 402)        assert result == 2    def test_categoriser_when_called_with_max_width_and_height_between_750_and_1350_returns_3(self):        categoriser = HvacRectangularCategoriser()        result = categoriser.evaluate(751, 402)        assert result == 3    def test_categoriser_when_called_with_max_width_and_height_between_1350_and_2100_returns_4(self):        categoriser = HvacRectangularCategoriser()        result = categoriser.evaluate(1350, 402)        assert result == 4    def test_categoriser_when_called_with_max_width_and_height_lt_2100_returns_5(self):        categoriser = HvacRectangularCategoriser()        result = categoriser.evaluate(751, 2100)        assert result == 5